import React,{useState} from 'react';
import './App.css';

function App() {

  let [titles,contents] = useState(['글제목1','글제목2','글제목3'],['글내용1','글내용2','글내용3']);

  return (
    <div className="App">
      <div className="black-nav">
        <div>개발 Blog</div>        
      </div>
      <div className='board_list'>
        <Board/>
      </div>
    </div>
  );
}

function Board(prop){
  return (
    <div className='board'>
      <h2>prop.title</h2>
      <p>prop.date</p>
      <p>prop.content</p>
    </div>
  );
}

export default App;
